INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES ("もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 40011, 1, 24001, 1, "リリ", 0, 2, 1, 125801, 321);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES ("初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 40011, 2, 24001, 1, "クリア", 0, 2, 1, 126001, 322);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES ("んーと。\nこれ、あげる。\nはい", 40011, 3, 24001, 1, "プレシア", 0, 2, 1, 126101, 323);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES ("あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 40011, 4, 24001, 1, "リリ", 0, 2, 2, 125801, 324);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES ("こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 40011, 5, 24001, 1, "クリア", 0, 2, 2, 126001, 325);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES ("お兄。\nきてくれて、うれしい", 40011, 6, 24001, 1, "プレシア", 0, 2, 2, 126101, 326);
